import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { Home } from './App';

ReactDOM.render(
  <Router>
    <Switch>
      <Route exact path="/home" component={Home}/>
    </Switch>
  </Router>,
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
